import React,{Component} from 'react';
import {Link} from 'react-router-dom';
import {Card_Four,Card_Eight} from './Cards';
import {Sdata_Four,Sdata_Eight} from './Data';
import { render } from '@testing-library/react';

export class Price extends Component{
   render(){
    return(
        <>
            <div>
                <section className="price_section">
                    <div className="price_banner"> 
                    <div className="container">
                        <div className="row justify-content-center price_content">
                            <div className="col-lg-6">
                                <div className="price_header">
                                    <div className="price_header_content">
                                    <h1>Our Pricing Plan</h1>
                                    </div>
                                </div>
                            </div>
                            <div className="col-lg-6">
                                <div className="price_image" style={{ backgroundImage: `url(${require("./images/price.png")})` }}>
                                
                                </div>
                            </div>
                        </div>
                    </div>
                     </div>
                </section>
                <section>
                    <div className="container">
                    <div className="row justify-content-center">
                           <div className="col-lg-6 text-center">
                               <div className=" price_digital_header">
                                   <h2>Digital Marketing plans</h2>
                                   <p>The world of marketing is changing. Marketing is shifting from TV to online. 
                                    We are here to take your digital marketing effort to next level.</p>
                               </div>
                           </div>
                       </div>
                        <div className="row justify-content-center">
                                {Sdata_Eight.map((val) =>{
                                    return(
                                        <Card_Eight
                                        imgsrc = {val.imgsrc}
                                        title = {val.title}
                                        pera = {val.pera}
                                        
                                        />
                                    )
                                })}
                        </div>
                    </div>
                </section>
               <div className="set_svg">
               <svg className="price_svg" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 1440 320"><path fill="#fff" fill-opacity="1" d="M0,160L80,133.3C160,107,320,53,480,58.7C640,64,800,128,960,144C1120,160,1280,128,1360,112L1440,96L1440,0L1360,0C1280,0,1120,0,960,0C800,0,640,0,480,0C320,0,160,0,80,0L0,0Z"></path></svg>
               <section className="py-5 price_bg">
                
                    <div className="container">
                    <div className="row justify-content-center pb-5">
                           <div className="col-lg-6 text-center">
                               <div className="service_role_header">
                                   <h2>Digital Marketing plans</h2>
                                   <p>The world of marketing is changing. Marketing is shifting from TV to online. 
                                    We are here to take your digital marketing effort to next level.</p>
                               </div>
                           </div>
                       </div>
                        <div className="row justify-content-center">
                            {Sdata_Four.map((val) =>{
                                return(
                                    <Card_Four
                                    title_one = {val.title_one}
                                    imgsrc = {val.imgsrc}
                                    title_two = {val.title_two}
                                    pera_one = {val.pera_one}
                                    pera_two = {val.pera_two}
                                    pera_three = {val.pera_three }
                                    pera_four = {val.pera_four}
                                    pera_five = {val.pera_five}
                                    />
                                )
                            })}
                        </div>
                    </div>
                </section>
               </div>
            </div>
        </>
    )
   }
    
}
